function App(){
  const handleClick = () => {
    console.log("Clicked")
  }

  return(
    <div className="box">
      <button className="button is-primary" onClick={handleClick}>Add Animal</button>
      <div class="card">
        <div class="card-image">
          <figure class="image is-4by3">
            <img src="https://bulma.io/images/placeholders/1280x960.png" alt="Placeholder image"/>
          </figure>
        </div>
      </div>
    </div>
  )
}

export default App
